script: |
  super -f text -I q10447.spq | sort > q10447.out

inputs:
  - name: q10447.spq
    data: |
      SELECT + col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE - ( - col1 ) IN ( - col1 + + + 29 * - + col0 * col0 + - - col0 + + col2 * - col1 );
  - name: tab2

outputs:
  - name: q10447.out
    data: |
